    \begin{document}
    \begin{tikzpicture}[node distance=1cm]
    \tikzstyle{startstop} = [ellipse, draw, fill=gray!20, minimum width=2cm, minimum height=1cm]
    \tikzstyle{process} = [rectangle, draw, fill=white, minimum width=2.5cm, minimum height=1cm]
    \tikzstyle{decision} = [diamond, draw, fill=white, aspect=2, minimum width=2cm, minimum height=1cm]
    \tikzstyle{arrow} = [thick,->,>=stealth]

    % Nodes
    \node (input) [startstop] {Input};
    \node (initialization) [process, below of=input] {Initialization};
    \node (graybox) [rectangle, draw, fill=gray!10, minimum width=6cm, minimum height=4cm, below of=initialization] {};
    \node (computation) [process, left of=graybox, xshift=-3cm] {Computation};
    \node (grid) [process, below of=computation] {Grid variation};
    \node (feasibleOp) [process, below of=grid] {Generation of Feasible Operation Region};
    \node (feasiblePlan) [process, below of=feasibleOp] {Generation of Feasible Planning Region};
    \node (decision) [decision, below of=feasiblePlan, yshift=-1cm] {Additional Grid?};
    \node (output) [startstop, right of=decision, xshift=3cm] {Output};

    % Arrows
    \draw [arrow] (input) -- (initialization);
    \draw [arrow] (initialization) -- (graybox);
    \draw [arrow] (computation) -- (grid);
    \draw [arrow] (grid) -- (feasibleOp);
    \draw [arrow] (feasibleOp) -- (feasiblePlan);
    \draw [arrow] (feasiblePlan) -- (decision);
    \draw [arrow] (decision) -- node[above] {False} (grid);
    \draw [arrow] (decision.east) -- ++(0.5,0) |- node[below] {True} (output);
\end{tikzpicture}
    \end{document}

