    \begin{tikzpicture}
    % Define the radius and center
    \def\radius{2}
    \coordinate (O) at (0,0);
    \coordinate (P) at (-\radius,0);
    \coordinate (Q) at (\radius,0);

    % Draw the semicircle
    \draw[thick] (P) arc[start angle=180,end angle=0,radius=\radius];

    % Draw points P, Q, and O
    \fill (P) circle (2pt) node[below] {P};
    \fill (Q) circle (2pt) node[below] {Q};
    \fill (O) circle (2pt) node[above] {O};

    % Draw a point on the semicircle and the line from P
    \coordinate (A) at (-\radius/2,\radius);
    \fill (A) circle (2pt);
    \draw[blue, thick] (P) -- (A);

    % Draw the second point on the semicircle
    \coordinate (B) at (\radius/2,\radius);
    \fill (B) circle (2pt);
    \draw[blue, thick] (A) -- (B);

    % Draw angle theta
    \draw[red, thick] (O) -- (A);
    \draw[red, thick] (O) -- (P);
    \node[red] at (-0.5,0.5) {$\theta$};
\end{tikzpicture}
    \end{document}

