    \begin{tikzpicture}[node distance=1.5cm, every node/.style={draw, rectangle, rounded corners, align=center}]
    % Left section
    \node (driver) {Driver script};
    \node (solver) [above=of driver] {Diophantine solver Fourier transform};
    \node (n) [left=of driver] {n};

    \draw[->] (driver) -- node[midway, right] {External call} (solver);
    \draw[->] (solver) -- node[midway, right] {Result} (driver);
    \draw[->] (n) -- (driver);

    % Right section
    \node (sat) [below=of solver, xshift=4cm] {Programmatic SAT solver};
    \draw[->] (solver) -- node[midway, right] {Partial assignment} (sat);
    \draw[->] (sat) -- node[midway, right] {Conflict clause} (solver);
    \draw[dashed, ->] (driver.east) -- ++(0.5,0) |- (sat.west) node[midway, above] {SAT instances};
    \draw[->] (sat.east) -- ++(1,0) node[midway, above] {Enumeration in order n};

    % Central connection
    \draw[dashed, ->] (solver.east) -- ++(1,0) |- (solver.west) node[midway, above] {Encoding information};
\end{tikzpicture}
    \end{document}

