    \begin{tikzpicture}
    % First Graph (K^*_{1,n})
    \begin{scope}
        \node[circle, draw, fill=black, inner sep=2pt] (c) at (0,0) {};
        \foreach \i in {1,2,3,4,5} {
            \node[circle, draw, fill=black, inner sep=2pt] (v\i) at (-1,\i) {};
            \draw (c) -- (v\i);
        }
        \node at (0,-1.5) {K^*_{1,n}};
    \end{scope}

    \hspace{2cm} % Space between graphs

    % Second Graph (K^*_n)
    \begin{scope}[xshift=6cm]
        \foreach \i in {1,2,3,4,5} {
