\node (features) [draw, rectangle, above=0.5cm of encoder] {Features Extraction};
\node (gnn) [draw, rectangle, below=0.5cm of features] {GNN};
\node (sampler) [draw, rectangle, below=0.5cm of gnn] {Sampler};

% Latent Section
\node (latent) [draw, ellipse, right=2cm of encoder] {Latent};
\node (mlp1) [draw, rectangle, above=0.5cm of latent] {MLP};
\node (mlp2) [draw, rectangle, below=0.5cm of mlp1] {MLP};
\node (mlp3) [draw, rectangle, below=0.5cm of mlp2] {MLP};

% Decoder Section
\node (decoder) [draw, ellipse, right=2cm of latent] {Decoder};
\node (decoderMLP) [draw, rectangle, below=0.5cm of decoder] {MLP};

% Multiplex Section
\node (multiplex) [draw, ellipse, right=2cm of decoder] {Multiplex};
\node (multiplexMLP) [draw, rectangle, below=0.5cm of multiplex] {MLP};
\node (energyBound) [draw, rectangle, below=0.5cm of multiplexMLP, fill=pink] {Energy Bound};
\node (energyLabel) [below=0.1cm of energyBound] {$G(\tau)$};

% Connections
\draw[->] (input) -- (encoder);
\draw[->] (encoder) -- (features);
\draw[->] (features) -- (gnn);
\draw[->] (gnn) -- (sampler);
\draw[->] (sampler.east) -- ++(0.5,0) |- (latent.west);
