\draw[->] (decoder) -- (decoderMLP);
\draw[->] (decoderMLP.east) -- ++(0.5,0) |- (multiplex.west);
\draw[->] (multiplex) -- (multiplexMLP);
\draw[->] (multiplexMLP.east) -- ++(0.5,0) |- (energyBound.west);
