    \draw[->] (udg1) -- (udg2);
    \draw[->] (udg2) -- (udg3);
    \draw[->] (udg3) -- (udg4);
    \draw[->] (udg3.east) -- ++(0.5,0) -- ++(0,1) -- (udg5);
    \draw[->] (udg4) -- (udg6);

    \node[draw=dashed, blue, fit=(udg1)(udg2)(udg3)(udg4)(udg6), inner sep=0.5cm] {};

    % Projection and Reconstruction
    \node (pr1) [below=of udg6, yshift=1cm] { \( \mathcal{P}\left(u_i^n\right), \) \( \mathcal{P}\left(F_i^n\right), \) \( \mathcal{P}\left(S_i^n\right) \)};

    \node[draw=dashed, blue, fit=(pr1), inner sep=0.5cm] {};

    % FD Loop
    \node (fd1) [below=of pr1, yshift=1cm] {Send ghost cells.};
    \node (fd2) [below=of fd1] {FD reconstruction.};
    \node (fd3) [below=of fd2] {Compute \( w_i^{n+1} \).};
    \node (fd4) [below=of fd3] {TCH \( \left(w_2^{n+1}\right) \)};
    \node (fd5) [below=of fd4] {Passed};
    \node (fd6) [below=of fd4, xshift=3cm] {Failed};
    \node (fd7) [below=of fd5] { \( u_i^{n+1} = w_i^{n+1} \).};

    \draw[->] (fd1) -- (fd2);
    \draw[->] (fd2) -- (fd3);
    \draw[->] (fd3) -- (fd4);
    \draw[->] (fd4) -- (fd5);
    \draw[->] (fd4.east) -- ++(0.5,0) -- ++(0,1) -- (fd6);
    \draw[->] (fd5) -- (fd7);

    \node[draw=dashed, blue, fit=(fd1)(fd2)(fd3)(fd4)(fd7), inner sep=0.5cm] {};
\end{tikzpicture}
    \end{document}

