        \node[font=\sffamily] at (0, -\i*2.5 + 0.9) {\label};

        \foreach \j in {1, 2, 3} {
            \draw[->] (-1.5 + \j*1.5/4, -\i*2.5 + 1) -- (-1.5 + (\j-1)*1.5/4, -\i*2.5 + 2);
            \draw[->] (1.5 - \j*1.5/4, -\i*2.5 + 1) -- (1.5 - (\j-1)*1.5/4, -\i*2.5 + 2);
        }
    }
